function ShowAppointment (){
    
        const doctor=[
           {
            "Name":"Ahmed",
            "speciality":"dentist",
            "Day1":"sunday",
            "Start1" :"1:00",
            "end1":"2:00"
            },
            {
              "Name":"Ahmed",
              "speciality":"dentist",
              "Day1":"monday",
              "Start1" :"2:00",
              "end1":"3:00"
            },
            {
              "Name":"osama",
              "speciality":"dentist",
              "Day1":"monday",
              "Start1" :"2:00",
              "end1":"3:00"
            },

        ];
        const [doctors, setdoctors] = useState([]);
        useEffect(() => {
          const fetchData = async () => {
            try {
              // Assuming the JSON file is in the public folder
              const response = await fetch('/data.json');
              const jsonData = await response.json();
              setData(jsonData.users);
            } catch (error) {
              console.error('Error fetching data:', error);
            }
          };
      
          fetchData();
        }, []);
      
        return(
        <div className='assign'>
            <u><p className='home-logout'><a href='/SignInPage'>logout</a></p></u>
            <u><p className='home-logout'><a href='/'>Home</a></p></u>
            <h1 className='header2'>Appointments</h1>
            <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Speciality</th>
          <th>Day</th>
          <th>Start Time</th>
          <th>End Time</th>
        </tr>
      </thead>
      <tbody>
        {doctors.map((doctors, index) => {
          // Use an if statement to conditionally render appointments with the name "osama"
          if (doctors.Name.toLowerCase() === 'osama') {
            return (
              <tr key={index}>
                <td>{doctors.Name}</td>
                <td>{doctors.speciality}</td>
                <td>{doctors.Day1}</td>
                <td>{doctors.Start1}</td>
                <td>{doctors.end1}</td>
              </tr>
            );
          } else {
            return null;
          }
        })}
      </tbody>
    </table>
            <button ><a href='/ChooseDoc'>Back</a></button>
        </div>
        )
    
        }  

export default ShowAppointment;
